package main;

import java.util.Scanner;

import compiler.CompilerHelper;
import compiler.DockerHelper;
import parser.Parser;
import parser.Wrapper;

public class Main {
	public static final String WRAPPER_FILE_SUFFIX = "-wrapper";

	public static void main(String[] args) {
		try {
			DockerHelper.startContainer();

			Scanner scanner = new Scanner(System.in);
			System.out.print("Enter config file location: ");
			String filename = scanner.nextLine();

			Parser parser = new Parser(filename);

			Wrapper wrapper = parser.parse();
			wrapper.toFile(filename);

			CompilerHelper.compileWrapper(filename);

			System.out.print("Enter student code directory: ");
			String studentDir = scanner.nextLine();

			CompilerHelper.compileStudentCode(studentDir, filename);

			CompilerHelper.trace("test1");

			DockerHelper.stopContainer();
			scanner.close();

		} catch (Exception e) {
			e.printStackTrace();
		}
	}
}

package compiler;

public class CommandLineHelper {

	public static int execute(String[] command) throws Exception {
		return execute(command, false);
	}

	public static int execute(String[] command, boolean silent) throws Exception{
		if(!silent) System.out.println("Executing: " + String.join(" ", command));

		ProcessBuilder pb = new ProcessBuilder();
		if(silent) {
			pb.command(command);
		} else {
			pb.command(command).inheritIO();
		}

		Process process = pb.start();

		return process.waitFor();
	}

	public static int executeInDocker(String[] command) throws Exception {
		return executeInDocker(command, false);
	}

	public static int executeInDocker(String[] command, boolean silent) throws Exception {
		String[] dockerCommand = new String[command.length+3];

		dockerCommand[0] = DockerHelper.DOCKER_PATH;
		dockerCommand[1] = "exec";
		dockerCommand[2] = DockerHelper.CONTAINER_NAME;

		for(int i=0; i<command.length; i++) {
			dockerCommand[i+3] = command[i];
		}

		return execute(dockerCommand, silent);
	}
}

package compiler;

public class DockerHelper {
	public static final String IMAGE_NAME = "nalingaddis/valgrind";
	public static final String CONTAINER_NAME = "grader-container";
	public static final String DOCKER_PATH = "/usr/local/bin/docker";

	public static int startContainer() throws Exception {
		String[] command = {
				DOCKER_PATH,
				"inspect",
				CONTAINER_NAME
		};

		if(CommandLineHelper.execute(command, true) == 0) {
			command = new String[]{
					DOCKER_PATH, 
					"start",
					CONTAINER_NAME,
			};
		} else {
			command = new String[]{
					DOCKER_PATH, 
					"run",
					"-it",
					"-d",
					"--mount", 
					"type=bind,src="+System.getProperty("user.dir")+",target=/home",
					"--name",
					CONTAINER_NAME,
					IMAGE_NAME
			};
		}

		return CommandLineHelper.execute(command);
	}

	public static int stopContainer() throws Exception {
		String[] command = {
				DOCKER_PATH,
				"stop",
				CONTAINER_NAME
		};

		return CommandLineHelper.execute(command);
	}
}

